elmed if your first attempt does not come out nice like this one, I still screw up all the time! Sourdough bread baking is one of the trickiest crafts in the kitchen to master, and thats why I love it so much! #sourdough #breadmaking #homebaking #bread\n\n-Recipe -\n\n300 grams - whole wheat flower \n300 grams - all purpose or bread flour \n512 grams - water \n63 grams - starter \n10 grams salt \n\nMilling flour - I’m aware that most people don’t have their own flour mill, so this step is optional, and if you don’t find your self some decent whole wheat flour. If you do mill your own flour make sure you sift some of the bran out to create a high extraction flour and a product that is a little easier to work with\n\nSteps and timing - Adjust timing to your schedule! \n\n3:00pm - combine flour with water and let it sit for at least 1 hour. Ideally you wait 4-5 hours but its not necessary. This step is called Autolyse which hydrates the flour and also develops some sugars in the flour for a better end result \n\n3:00pm feed your starter equal parts (by weight) flour and water and let sit for 4-5 hours until active \n\n7-8:00pm - add the starter to the dough and start your stretch and folds every thirty minutes for the first 2 hours of the bulk rise. On the second or 3rd stretch and fold, add your seasoning of choice to the dough. \n\n10:00pm - stretch and folds are done, cover and let it bulk rise/ferment overnight. \n\n7:00am - dough has risen, give it one last stretch and fold and remove it on the work surface to bench rest for 20-30 minutes.\n\n7:30am - form loaf and place in some sort of proofing basket for 1-2 hours until it has risen (like in video). \n\n8:30am- Preheat heavy pan with lid on at 500 degrees for 1 hour \n\n9:30am - Flip loaf out on parchment paper, score the loaf and transfer to the pan. Put lid on and bake for 20 minutes\n\n9:50am - take lid of, turn over down to 450 and bake uncovered for 20 more minutes\n\nlet cool if possible (usually not…)  and enjoy! \n\n\nAll music is royalty free from premiumbeats.com \nTruth to Tell - Big Score Audio \nChopin - nocturne op. 9 - James Langevin","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/stoPYwdPU-E/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDuU12dWl-KIGnTB1L5ie7Wgg3WAQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/stoPYwdPU-E/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBNV216AsCurD5MzBtW7Kqbzl0rng","width":196,"height":110},{"url":"https://i.ytimg.com/vi/stoPYwdPU-E/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLA4euOe4C6i9d_2KKO28idrEdbCuw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/stoPYwdPU-E/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAeX72F-V08raeTe6L-9dVlORzg3A","width":336,"height":188},{"url":"https://i.ytimg.com/vi/stoPYwdPU-E/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"3899735","author":"Pro Home Cooks","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"playerConfig":{"audioConfig":{"loudnessDb":-10.940001,"perceptualLoudnessDb":-24.940001,"enablePerFormatLoudness":true},"playbackStartConfig":{"startSeconds":1,"startPosition":{"streamTimeMillis":"1000"}},"streamSelectionConfig":{"maxBitrate":"5860000"},"mediaCommonConfig":{"dynamicReadaheadConfig":{"maxReadAheadMediaTimeMs":120000,"minReadAheadMediaTimeMs":15000,"readAheadGrowthRateMs":1000},"mediaUstreamerRequestConfig":{"videoPlaybackUstreamerConfig":"CpQLCq8HCAAlAACAPy0zM3M_NT0Klz9YAWgBchoKFm1mczJfY21mc193ZWJfdjNfMl8wMDMYAHiPTqABAagBAJACAbgCAMgCAdoC0gEQsOoBGKhGIKCcASignAEwmHVwiCeAAfQDuAEB4AEDkAIBmAIMoAIBwAIB0AIC4AIB6AIEgAMCiAOIJ5gDAagDA8ADAcgDAdADAfgDAYAEAYgEAZAEAZgEAaAEAagEAcgEAdAEAdgEAeAEAOgEAfgEB4AFfYgFAbAFAbgFAcAFAcgFAdAFAdgFAeAF0A_oBQH4BdAPgAYBkAYBuAYBwAYB0AYB2AYB6AYB8AYB-AYBgAfQD5AHAagHAcgHAdgHAfAHAZ0IAACAv6AI6Af If you do mill your own flour make sure you sift some of the bran out to create a high extraction flour and a product that is a little easier to work with\n\nSteps and timing - Adjust timing to your schedule! \n\n3:00pm - combine flour with water and let it sit for at least 1 hour. Ideally you wait 4-5 hours but its not necessary. This step is called Autolyse which hydrates the flour and also develops some sugars in the flour for a better end result \n\n3:00pm feed your starter equal parts (by weight) flour and water and let sit for 4-5 hours until active \n\n7-8:00pm - add the starter to the dough and start your stretch and folds every thirty minutes for the first 2 hours of the bulk rise. On the second or 3rd stretch and fold, add your seasoning of choice to the dough. \n\n10:00pm - stretch and folds are done, cover and let it bulk rise/ferment overnight. \n\n7:00am - dough has risen, give it one last stretch and fold and remove it on the work surface to bench rest for 20-30 minutes.\n\n7:30am - form loaf and place in some sort of proofing basket for 1-2 hours until it has risen (like in video). \n\n8:30am- Preheat heavy pan with lid on at 500 degrees for 1 hour \n\n9:30am - Flip loaf out on parchment paper, score the loaf and transfer to the pan. Put lid on and bake for 20 minutes\n\n9:50am - take lid of, turn over down to 450 and bake uncovered for 20 more minutes\n\nlet cool if possible (usually not…)  and enjoy! \n\n\nAll music is royalty free from premiumbeats.com \nTruth to Tell - Big Score Audio \nChopin - nocturne op. 9 - James Langevin"},"lengthSeconds":"531","ownerProfileUrl":"http://www.youtube.com/@ProHomeCooks","externalChannelId":"UCzH5n3Ih5kgQoiDAQt2FwLw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","C ://amzn.to/3f8B04e\n2 Oval Bread Banneton:https://amzn.to/39C6e2y\nDanish Bread Whisk:https://amzn.to/2DiTaCX\nLe Parfait 1L Jar for Sourdough Starter: https://amzn.to/308Cd7a\nBench Scrapers: https://amzn.to/3QO8ud4\nGrain Miller: https://amzn.to/46LRudy\nDutch Oven: https://amzn.to/3uxMgEt\n-\nDon't be overwhelmed if your first attempt does not come out nice like this one, I still screw up all the time! Sourdough bread baking is one of the trickiest crafts in the kitchen to master, and thats why I love it so much! #sourdough #breadmaking #homebaking #bread\n\n-Recipe -\n\n300 grams - whole wheat flower \n300 grams - all purpose or bread flour \n512 grams - water \n63 grams - starter \n10 grams salt \n\nMilling flour - I’m aware that most people don’t have their own flour mill, so this step is optional, and if you don’t find your self some decent whole wheat flour. If you do mill your own flour make sure you sift some of the bran out to create a high extraction flour and a product that is a little easier to work with\n\nSteps and timing - Adjust timing to your schedule! \n\n3:00pm - combine flour with water and let it sit for at least 1 hour. Ideally you wait 4-5 hours but its not necessary. This step is called Autolyse which hydrates the flour and also develops some sugars in the flour for a better end result \n\n3:00pm feed your starter equal parts (by weight) flour and water and let sit for 4-5 hours until active \n\n7-8:00pm - add the starter to the dough and start your stretch and folds every thirty minutes for the first 2 hours of the bulk rise. On the second or 3rd stretch and fold, add your seasoning of choice to the dough. \n\n10:00pm - stretch and folds are done, cover and let it bulk rise/ferment overnight. \n\n7:00am - dough has risen, give it one last stretch and fold and remove it on the work surface to bench rest for 20-30 minutes.\n\n7:30am - form loaf and place in some sort of proofing basket for 1-2 hours until it has risen (like in video). \n\n8: C8Q040EGAQiEwiVtIms1O2HAxVeMx4AHa2vK2o=","commandMetadata":{"webCommandMetadata":{"url":"/@ProHomeCooks","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCzH5n3Ih5kgQoiDAQt2FwLw","canonicalBaseUrl":"/@ProHomeCooks"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/saUT3pTb6OQeVNzSelFemx3wrn8ymSUAXchlOzXJOPL5KaotGydRSOcLLAeZttMW5MqzLUa6KdU=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"Wanna learn how to bake fresh, delicious, artisanal style sourdough bread at home?  (No matter how busy your schedule is)\nClick the link below and download my FREE bread baking checklists:\nhttps://prohomecooksu.com/5-sourdough...\n\nShop the gear in this video below!\nExtra Long Silicone Oven Mitts: https://amzn.to/2BBFL8E\nMisen Serrated Bread Knife: https://amzn.to/3sPpwzm\nEtekcity Digital Food Scale: https://amzn.to/305du3G\nBread Bosses Bread Lame: https://amzn.to/3f8B04e\n2 Oval Bread Banneton:https://amzn.to/39C6e2y\nDanish Bread Whisk:https://amzn.to/2DiTaCX\nLe Parfait 1L Jar for Sourdough Starter: https://amzn.to/308Cd7a\nBench Scrapers: https://amzn.to/3QO8ud4\nGrain Miller: https://amzn.to/46LRudy\nDutch Oven: https://amzn.to/3uxMgEt\n-\nDon't be overwhelmed if your first attempt does not come out nice like this one, I still screw up all the time! Sourdough bread baking is one of the trickiest crafts in the kitchen to master, and thats why I love it so much! #sourdough #breadmaking #homebaking #bread\n\n-Recipe -\n\n300 grams - whole wheat flower \n300 grams - all purpose or bread flour \n512 grams - water \n63 grams - starter \n10 grams salt \n\nMilling flour - I’m aware that most people don’t have their own flour mill, so this step is optional, and if you don’t find your self some decent whole wheat flour. If you do mill your own flour make sure you sift some of the bran out to create a high extraction flour and a product that is a little easier to work with\n\nSteps and timing - Adjust timing to your schedule! \n\n3:00pm - combine flour with water and let it sit for at least 1 hour. Ideally you wait 4-5 hours but its not necessary. This step is called Autolyse which hydrates the flour and also develops some sugars in the flour for a better end result \n\n3:00pm feed your starter equal parts (by weight) flour and water and let sit for 4-5 hours until active \n\n7-8:00pm - add the starter to the dough and start your stretch and folds every thirty minutes for the first 2 hours of the bulk rise. On the second or 3rd stretch and fold, add your seasoning of choice to the dough. \n\n10:00pm - stretch and folds are done, cover and let it bulk rise/ferment overnight. \n\n7:00am - dough has risen, give it one last stretch and fold and remove it on the work surface to bench rest for 20-30 minutes.\n\n7:30am - form loaf and place in some sort of proofing basket for 1-2 hours until it has risen (like in video). \n\n8:30am- Preheat heavy pan with lid on at 500 degrees for 1 hour \n\n9:30am - Flip loaf out on parchment paper, score the loaf and transfer to the pan. Put lid on and bake for 20 minutes\n\n9:50am - take lid of, turn over down to 450 and bake uncovered for 20 more minutes\n\nlet cool if possible (usually not…)  and enjoy! \n\n\nAll music is royalty free from premiumbeats.com \nTruth to Tell - Big Score Audio \nChopin - nocturne op. 9 - James Langevin","commandRuns":[{"startIndex":189,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CC8Q040EGAQiEwiVtIms1O2HAxVeMx4AHa2vK2pI4ae9urDsg-2yAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa2dGcVFYdW9FUFdhTzdCMFVnN0I1VHFrTnZGZ3xBQ3Jtc0ttM2txMnViM2xEQm5TSWI3QmpZamdJaHAyZEE1Y0R6YXVyMmg1aXRXR2pIUHFIellCSHZhWGlxdDVPYk9acmQ1Slo4NW1hSXA0Q3Y2eHdKaFRreUFBTWJTMW5sVV
